export const RouteNames = {
  HOME: {
    NAME: "home",
    PATH: "/",
  },
  STUDENT_LIST: {
    NAME: "studentList",
    PATH: "/student-list",
  },
  STUDENT_DETAILS: {
    NAME: "studentCard",
    PATH: "/students",
  },
  ADD_MARK: {
    NAME: "addMark",
    PATH: "/students-add-mark/:id",
  },
  ADD_STUDENT: {
    NAME: "addStudent",
    PATH: "/student-register",
  },
  ADD_TEACHER: {
    NAME: "addTeacher",
    PATH: "/teacher-register",
  },
  ADD_EMPLOYEE: {
    NAME: "addEmployee",
    PATH: "/employee-register",
  },
  CHANGE_SUBJECT: {
    NAME: "changeSubject",
    PATH: "/change-subject/:id",
  },
  EMPLOYEE_LIST: {
    NAME: "employeeList",
    PATH: "/employee-list",
  },
  TEACHER_LIST: {
    NAME: "teacherList",
    PATH: "/teacher-list",
  },
  ALL_LISTS: {
    NAME: "allLists",
    PATH: "/all-list",
  },
  CHANGE_FUNCTION: {
    NAME: "changeFunction",
    PATH: "/change-function/:id",
  },
  TEACHER_DETAILS: {
    NAME: "teacherDetails",
    PATH: "/teachers/:id",
  },
  EMPLOYEE_DETAILS: {
    NAME: "employeeDetails",
    PATH: "/employees/:id",
  },
};
